import React from 'react';
import logo from './logo.svg';
import './App.css';
import { HttpResponse, useApiClient } from './Services/api/apiClient';
import { useEffect, useState } from 'react';
import { TodoModel } from './types/apiClient';

 function App() {

     //const ApiClient = useApiClient();
     let todos = useApiClient();
     const [data, setData] = useState<TodoModel[]>([]);

     const getTodos = async () => {
         let response: HttpResponse<TodoModel[]>;

         response = await todos.getTodos();

         setData(response.body as TodoModel[]);
     };

    //console.log(todos);

     //const makeAPICall = async () => {
     //    try {
     //        fetch('https://localhost:7192/todo')
     //           .then(function (response) {
     //               // Do something with response
     //               const data = response.json();
     //               console.log({ data })
     //           });
     //        //const response = await fetch('https://localhost:7192/todo');
           
     //    }
     //    catch (e) {
     //        console.log(e)
     //    }
     //}
     useEffect(() => {
         getTodos();
     }, [])

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Todo List A
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
